    true,nt"url": null,nt"notes": "This is a database of total ionization cross
    sections of atoms and molecules by electron impact. The cross sections were calculated
    using the Binary-Encounter-Bethe (BEB) model, which combines the Mott cross section
    with the high-incident energy behavior of the Bethe cross section. Selected experimental
    data are included. Singly differential cross sections are included for H, He, and
    H2. Electron-impact excitation cross sections are also included for selected atoms.",nt"license_title":
